Overview
Ny Volgograd State University Medical dia iray amin'ireo malaza indrindra, ary tena malaza Sekoly ambony na any Rosia sy ny any ivelany. Tena mirehareha ny amin'ny tena-mahay fampianarana mpiasa, mandroso mpikaroka sy ny dokotera za-draharaha izay anarany dia izao tontolo izao-malaza. Misy amin'izao fotoana izao ny malaza tarihan'ny Rosiana siantifika, Akademisiana ao amin'ny Akademia Rosiana for Medical Siansa, Profesora Vladimir I. Petrov.
- maro be ny mety;
